INSERT INTO `movies` (`id`, `userId`, `tmdbId`, `title`, `overview`, `popularity`, `releaseDate`, `voteAverage`, `backdropPath`, `posterPath`, `isFeatured`, `dateCreated`, `dateUpdated`) VALUES
(1, 1, 1241982, 'Moana 2', 'After receiving an unexpected call from her wayfinding ancestors, Moana journeys alongside Maui and a new crew to the far seas of Oceania and into dangerous, long-lost waters for an adventure unlike anything she\'s ever faced.', 100.1, '2024-11-27', 6.899, 'https://image.tmdb.org/t/p/original//tElnmtQ6yz1PjN1kePNl8yMSb59.jpg', 'https://image.tmdb.org/t/p/original//yh64qw9mgXBvlaWDi7Q9tpUBAvH.jpg', 1, '2024-12-08 07:59:49', '2024-12-08 07:59:57'),
(2, 1, 1108427, 'Moana', 'In Ancient Polynesia, when a terrible curse incurred by Maui reaches the island of an impetuous Chieftain, his willful daughter answers the Ocean\'s call to seek out the demigod to set things right.  Live-action adaptation of the 2016 Disney animated film \'Moana\'', 100.059, '2026-07-09', 0, 'https://image.tmdb.org/t/p/original/null', 'https://image.tmdb.org/t/p/original//ys0jZr0quHERDUEoCboGQEKPvgQ.jpg', 1, '2024-12-08 08:00:21', '2024-12-08 08:00:37'),
(3, 1, 372058, 'Your Name.', 'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.', 102.64, '2016-08-26', 8.5, 'https://image.tmdb.org/t/p/original//dIWwZW7dJJtqC6CgWzYkNVKIUm8.jpg', 'https://image.tmdb.org/t/p/original//vfJFJPepRKapMd5G2ro7klIRysq.jpg', 1, '2024-12-08 08:07:25', '0000-00-00 00:00:00'),
(4, 1, 912649, 'Venom: The Last Dance', 'Eddie and Venom are on the run. Hunted by both of their worlds and with the net closing in, the duo are forced into a devastating decision that will bring the curtains down on Venom and Eddie\'s last dance.', 100.36, '2024-10-22', 6.4, 'https://image.tmdb.org/t/p/original//3V4kLQg0kSqPLctI5ziYWabAZYF.jpg', 'https://image.tmdb.org/t/p/original//aosm8NMQ3UyoBVpSxyimorCQykC.jpg', 1, '2024-12-08 08:11:43', '2024-12-15 05:00:09'),
(5, 1, 746036, 'The Fall Guy', 'Fresh off an almost career-ending accident, stuntman Colt Seavers has to track down a missing movie star, solve a conspiracy and try to win back the love of his life while still doing his day job.', 99.383, '2024-04-24', 7.1, 'https://image.tmdb.org/t/p/original//H5HjE7Xb9N09rbWn1zBfxgI8uz.jpg', 'https://image.tmdb.org/t/p/original//tSz1qsmSJon0rqjHBxXZmrotuse.jpg', 1, '2024-12-15 04:54:47', '0000-00-00 00:00:00'),
(6, 1, 762441, 'A Quiet Place: Day One', 'As New York City is invaded by alien creatures who hunt by sound, a woman named Sam fights to survive with her cat.', 189.031, '2024-06-26', 6.796, 'https://image.tmdb.org/t/p/original//6XjMwQTvnICBz6TguiDKkDVHvgS.jpg', 'https://image.tmdb.org/t/p/original//hU42CRk14JuPEdqZG3AWmagiPAP.jpg', 1, '2024-12-15 04:56:17', '0000-00-00 00:00:00');
